sys_variable_value.value:
(function execute(inputs, outputs) {
  try { 
    var r = new sn_ws.RESTMessageV2('api.football Matches', 'Get Matches');
    //r.setStringParameterNoEscape('id', customerID);

    var response = r.execute();
    var responseBody = response.getBody();
    parsedResponse = JSON.parse(responseBody);
    outputs.response_body = responseBody;
    outputs.parsed_Response = parsedResponse

    outputs.count_matches = parsedResponse.resultSet.count; //quantidade partidas 
    outputs.played_matches = parsedResponse.resultSet.played; //quantidade partidas jogadas
    outsputs.info_matches = parsedResponse.matches;
  }
  catch(ex) {
    var message = ex.message;
  }
})(inputs, outputs);

